Actionscript.script:
onEnterFrame = function () {
	if (_root.PauseGame == false) {
		play();
	} else {
		stop();
	}
};
RF = function () {
	randomnum = random(5);
	if (randomnum == 0 || randomnum == 1) {
		_parent.GoombaSummon(_parent._x+box._x, _parent._y+box._y, -2-Math.random()*5, 3+Math.random()*7);
	} else if (randomnum == 2 || randomnum == 3) {
		_parent.BobombSummon(_parent._x+box._x, _parent._y+box._y, -2-Math.random()*5, 3+Math.random()*7);
	} else {
		_parent.BombSummon(_parent._x+box._x, _parent._y+box._y, 0, 0);
	}
};
count = 0;
waittime = 15+random(9)+((_parent._parent.onscreencount-_parent._parent.defeatedcount)*2);
if (_parent.side == "R") {
	gotoAndPlay("Rwait");
} else {
	gotoAndPlay("Lwait");
}

for (i=0; i<random(2)+2; i++) {
	_root.Course.BackGFX.attachMovie("ExplodeBomb-ombCode", "ExplodeBomb-ombCode"+_root.Course.BackGFX.getNextHighestDepth(), _root.Course.BackGFX.getNextHighestDepth(), {_x:425+random(500), _y:-300-random(50), xspeed:Math.random()*6-3, yspeed:Math.random()*4-2});
}
_root.Course.BackGFX.attachMovie("ExplodeBomb-ombCode", "ExplodeBomb-ombCode"+_root.Course.BackGFX.getNextHighestDepth(), _root.Course.BackGFX.getNextHighestDepth(), {_x:(_root.Course.Char._x-_root.Course.BackGFX._x)+(Math.random()*6-3), _y:-300-random(50), xspeed:Math.random()*6-3, yspeed:Math.random()*4-2});
_root.Course.BackGFX.attachMovie("ExplodeBomb-ombCode", "ExplodeBomb-ombCode"+_root.Course.BackGFX.getNextHighestDepth(), _root.Course.BackGFX.getNextHighestDepth(), {_x:(_root.Course.Char._x-_root.Course.BackGFX._x)+(Math.random()*6-3), _y:-300-random(50), xspeed:Math.random()*6-3, yspeed:Math.random()*4-2});

for (i=0; i<random(2)+2; i++) {
	_root.Course.BackGFX.attachMovie("ExplodeBomb-ombCode", "ExplodeBomb-ombCode"+_root.Course.BackGFX.getNextHighestDepth(), _root.Course.BackGFX.getNextHighestDepth(), {_x:425+random(500), _y:-300-random(50), xspeed:Math.random()*6-3, yspeed:Math.random()*4-2});
}
_root.Course.BackGFX.attachMovie("ExplodeBomb-ombCode", "ExplodeBomb-ombCode"+_root.Course.BackGFX.getNextHighestDepth(), _root.Course.BackGFX.getNextHighestDepth(), {_x:(_root.Course.Char._x-_root.Course.BackGFX._x)+(Math.random()*6-3), _y:-300-random(50), xspeed:Math.random()*6-3, yspeed:Math.random()*4-2});
_root.Course.BackGFX.attachMovie("ExplodeBomb-ombCode", "ExplodeBomb-ombCode"+_root.Course.BackGFX.getNextHighestDepth(), _root.Course.BackGFX.getNextHighestDepth(), {_x:(_root.Course.Char._x-_root.Course.BackGFX._x)+(Math.random()*6-3), _y:-300-random(50), xspeed:Math.random()*6-3, yspeed:Math.random()*4-2});

prevFrame();
count++;
if (count>waittime) {
	lastnum = randomnum;
	randomnum = random(4);
	if (lastnum == randomnum) {
		randomnum = random(3);
	}
	if (randomnum == 0) {
		gotoAndPlay("RS1");
	} else if (randomnum == 1) {
		gotoAndPlay("RS2");
	} else if (randomnum == 2) {
		gotoAndPlay("RS3");
	} else {
		gotoAndPlay("RA1");
	}
	if (_parent.CheckNextMode()) {
		_parent.NextMode();
	}
}

prevFrame();
count++;
if (count>waittime) {
	lastnum = randomnum;
	randomnum = random(4);
	if (lastnum == randomnum) {
		randomnum = random(3);
	}
	if (randomnum == 0) {
		gotoAndPlay("LS1");
	} else if (randomnum == 1) {
		gotoAndPlay("LS2");
	} else if (randomnum == 2) {
		gotoAndPlay("LS3");
	} else {
		gotoAndPlay("LA1");
	}
	if (_parent.CheckNextMode()) {
		_parent.NextMode();
	}
}
